import React from 'react'
import styled from 'styled-components';
import $ from 'jquery';
const Container = styled.div`
margin-top:1rem;
background:transparent;
display:flex;
flex-direction:column;
width:100%;
height:45rem;
align-items:center;
justify-content:center;
.py-60
	padding 60px 0
	@media only screen and (max-width: 768px)
		padding 52px 0
		
section
	background: #F3F3F3
	
h2
	font-family Roboto-Light
	font-size 32px
	color #000000
	line-height 1.25
	text-transform uppercase
	@media only screen and (max-width: 768px)
		font-size 24px

.text-control-1
	h2
		margin-bottom 20px
		@media only screen and (max-width: 768px)
			margin-bottom 16px

.q-mark
	font-family Roboto-bold
	color #D40119
	padding 18px 0 18px 18px;
	
.question
	font-family Roboto
	font-size 20px
	color #5C5C5C
	line-height 1.5
	padding: 20px;
	margin-bottom: 0
	
.material-icons.drop
	padding: 20px;
	font-size 2rem
	color #D40119
	transition transform .5s ease-in-out
	
.answer
	font-size 16px
	color #5C5C5C
	padding: 16px;
	padding-left: 52px;
	padding-bottom: 32px;
	background-color: white;
	overflow: hidden;
	
///////////	

.accordion
	background-color: #ffffff;
	color: #444;
	cursor: pointer;
	width: 100%;
	margin-bottom: 20px
	text-align: left;
	border: none;
	outline: none;
	transition: 0.4s;
	box-shadow: 0 1px 1px 0 rgba(0,0,0,0.14), 0 2px 1px -1px rgba(0,0,0,0.12), 0 1px 3px 0 rgba(0,0,0,0.20);
	border-radius: 4px;
	@media only screen and (max-width: 768px)
		margin-bottom: 16px

.question-wrapper
	display flex
	justify-content space-between
	align-items center
	transition background-color .25s ease-in-out
	
.answer-wrapper
	display none
	
.icon-expend
	transform rotateX(180deg)
	transition transform .75s ease-in-out
	
.active, .accordion:hover .question-wrapper
	background-color: #EBEBEB
	p
		color: #3D3D3D
		

////////

.container
	width: 100%
	padding-right: 20px
	padding-left: 20px
	margin-right: auto
	margin-left: auto
	@media only screen and (min-width: 768px)
		max-width: 768px
	@media only screen and (min-width: 992px)
		max-width: 1144px

`;

$(".question-wrapper").click( function () {
    var container = $(this).parents(".accordion");
    var answer = container.find(".answer-wrapper");
    var trigger = container.find(".material-icons.drop");
      var state = container.find(".question-wrapper");
    
    answer.animate({height: "toggle"}, 100);
    
    if (trigger.hasClass("icon-expend")) {
      trigger.removeClass("icon-expend");
          // state.removeClass("active");
    }
    else {
      trigger.addClass("icon-expend");
          // state.addClass("active");
    }
    
    if (container.hasClass("expanded")) {
      container.removeClass("expanded");
    }
    else {
      container.addClass("expanded");
    }
  });

function About() {
  return (
    <Container>
        <h2>About Us</h2>
        <main>
  <details open>
    <summary>How I solve this issue?</summary>
    <div class="faq__content">
      <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Dolor suscipit, iure tenetur eveniet, vero tempore delectus? Perferendis, quisquam ullam consequuntur?</p>
    </div>
  </details>

    <details>
    <summary>How to input your data on this board?</summary>
    <div class="faq__content">
      <p>Fugiat quo voluptas nulla pariatur? Et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque. Accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo.</p>
    </div>
  </details>
   </main>
    </Container>
  )
}

export default About
